import React from "react";
import "./task.css";
class TimeCreated extends React.Component {
  render() {
    const { discription, created } = this.props;
    return (
      <div className="view">
        <input className="toggle" type="checkbox" />
        <label>
          <span className="description">{discription}</span>
          <span className="created">{created}</span>
        </label>
        <button className="icon icon-edit"></button>
        <button className="icon icon-destroy"></button>
      </div>
    );
  }
}
const Task = ({ discription, created }) => {
  return (
    <div className="view">
      <input className="toggle" type="checkbox" />
      <label>
        <span className="description">{discription}</span>
        <span className="created">{created}</span>
      </label>
      <button className="icon icon-edit"></button>
      <button className="icon icon-destroy"></button>
    </div>
  );
};
export default Task;
